import styled from 'styled-components'
import React from 'react'
import { ArrowLeftOutlined, ArrowRightOutlined } from '@material-ui/icons';

const Container = styled.div`
width: 100%;
height: 100vh;
display: flex;
position: relative;
`

const Arrow = styled.div`
width: 50px;
height: 50px;
background-color: #fff7f7;
border-radius: 50%;
display: flex;
align-items: center;
justify-content: center;
position: absolute;
top: 0;
bottom: 0;
margin: auto;
`

export const Slider = () => {
  return (
    <Container>
      <Arrow>
      <ArrowRightOutlined/>
      </Arrow>
      <Arrow>
      <ArrowRightOutlined/>
      </Arrow>
    </Container>
  )
}
